                    output = result;
                }
                Console.WriteLine(DateTime.Now + " Result -> " + output.ToString());
            }
            public static List<string> ReadAllLines(string from = @"in.txt")
            {
                string dataIn = System.IO.File.ReadAllText(from);
                var lines = dataIn.Split('\n');
                var ret = new List<string>();
                foreach (var line in lines)
                {
                    ret.Add(line.Trim());
                }
                return ret;
            }
            public static int ToInt(string s)
            {
                return Convert.ToInt32(s);
            }
            public static ulong ToULong(string s)
            {
                return Convert.ToUInt64(s);
            }
        }

        public static char[,] bigPicture = new char[96, 96];

        public static void RotateBig()
        {
            var temp = new char[96, 96];
            for (var y = 0; y < 96; y++)
            {
                for (var x = 0; x < 96; x++)
                {
                    temp[96 - 1 - y, x] = bigPicture[x, y];
                }
            }
            bigPicture = temp;
        }

        public static void FlipBig()
        {
            var temp = new char[96, 96];
            for (var y = 0; y < 96; y++)
            {
                for (var x = 0; x < 96; x++)
                {
                    temp[x, 96 - 1 - y] = bigPicture[x, y];
                }
            }
            bigPicture = temp;
        }

        public class Tile
        {
            public ulong no;
            private static int w = 10;
            private static int h = 10;
            public char[,] tileData = new char[w, h];
            public List<Tile> possibleLeft = new List<Tile>();
            public List<Tile> possibleTop = new List<Tile>();
            public List<Tile> possibleRight = new List<Tile>();
            public List<Tile> possibleBottom = new List<Tile>();

            public void SetBig(int xa, int ya)
            {
                for (var y = 1; y < h - 1; y++)
                {
                    for (var x = 1; x < w - 1; x++)
                    {
                        bigPicture[xa + x - 1, ya + y - 1] = tileData[x, y];
                    }
                }
            }

            public void CopyTo(Tile t)
            {
                this.no = t.no;
                for (var y = 0; y < h; y++)
                {
                    for (var x = 0; x < w; x++)
                    {
                        tileData[x, y] = t.tileData[x, y];
                    }
                }
            }

            public void RotateRight()
            {
                var temp = new char[w, h];
                for (var y = 0; y < h; y++)
                {
                    for (var x = 0; x < w; x++)
                    {
                        temp[h - 1 - y, x] = tileData[x, y];
                    }
                }
                this.tileData = temp;
            }

            public void Flip()
            {
                var temp = new char[w, h];
                for (var y = 0; y < h; y++)
                {
                    for (var x = 0; x < w; x++)
                    {
                        temp[x, h - 1 - y] = tileData[x, y];
                    }
                }
                this.tileData = temp;
            }

            public bool CheckTop(Tile t)
            {
                for (var x = 0; x < w; x++)
                {
                    if (tileData[x, 0] != t.tileData[x, h - 1])
                        return false;
                }
                return true;
            }

            public bool CheckBottom(Tile t)
            {
                for (var x = 0; x < w; x++)
                {
                    if (tileData[x, h - 1] != t.tileData[x, 0])
                        return false;
                }
                return true;
            }

            public bool CheckLeft(Tile t)
            {
                for (var y = 0; y < h; y++)
                {
                    if (tileData[0, y] != t.tileData[w - 1, y])
                        return false;
                }
                return true;
            }

            public bool CheckRight(Tile t)
            {
                for (var y = 0; y < h; y++)
                {
                    if (tileData[w - 1, y] != t.tileData[0, y])
                        return false;
                }
                return true;
            }

            public void Print()
            {
                Console.WriteLine(no + ": ");
                for (var y = 0; y < h; y++)
                {
                    for (var x = 0; x < w; x++)
                    {
                        Console.Write(tileData[x, y]);
                    }
                    Console.WriteLine();
                }
                Console.WriteLine();
            }
        }

